import styled from 'styled-components';

export default styled.div`
  	height: 45px;
  	width: 100%;
  	top: 0;
  	position: relative;
  	display: flex;
  	flex-direction: row;
  	padding: 0;
  	margin: 0;

  	h1 {
  		color: #444;
  		margin-top: 0;
  		margin-left: 50px;
  		margin-right: auto;
  	}

  	button {
  		margin: 5px 50px 5px 0px;  		
  		margin-left: auto;
  	}

  	.myButton {
	box-shadow:inset 0px 34px 0px -15px #b54b3a;
	background-color:#a73f2d;
	border:1px solid #241d13;
	display:inline-block;
	cursor:pointer;
	color:#ffffff;
	font-family:Arial;
	font-size:15px;
	font-weight:bold;
	padding:9px 23px;
	text-decoration:none;
	text-shadow:0px -1px 0px #7a2a1d;
	}
	.myButton:hover {
	background-color:#b34332;
	}
	.myButton:active {
	position:relative;
	top:1px;
	}

`;
